function InstaLoader({saves}) {
	return (
		<>
			{data.saves.map((index, saves) => (
				<div key={index}>
					<a href={saves.linkURL}>
						<img src={saves.imageURL} alt="" />
					</a>
				</div>
			))}
			;
		</>
	);
}

InstaLoader.getInitialProps = async ({req}) => {
	const res = await fetch("");
	const json = await res.json();
	return {saves: json.insta_saved_posts};
};

export default InstaLoader;
